import React from 'react';
import Navbar from './components/Navbar';

function App() {
  return (
    <div className="App">
        <Routes>
          <Route path="/" element={<Services/>}/>
          <Route path="/login" element={<Login/>}/>
          <Route path="/signup" element={<Signup/>}/>
      </Routes>
    </div>
  );
}

export default App;
